import Link from 'next/link';
import Layout from '../components/Layout';


const About = () => 
<Layout title="About">
<Link href="/">
<a>Go to home</a>
</Link>
<p>A JavaScript programmer</p>
<img src="/public/static/javascript_logo.png"  height="200px" />
</Layout>;

export default About;
